import React, {useState} from 'react';
import './Channel.css';


import Messages from '../Messages/Messages';
//import MessageSend from '../MessageSend/MessageSend';


//list of channels
var channel = {
    name: 'Fake channel',
};



const Channel = () => {
    return(
        <div className="channel">
            <Messages channel={channel}/>

        </div>
    );
}

export {channel};
export default Channel;
